import { Swiper, SwiperSlide } from "swiper/react";
export default function Slider() {
  return (
    <swiper-container
      slides-per-view="1"
      speed="500"
      loop="true"
      css-mode="true"
      navigation="true"
      pagination="true"
      scrollbar="true"
    >
      <swiper-slide></swiper-slide>
      <swiper-slide>Slide 2</swiper-slide>
      <swiper-slide>Slide 3</swiper-slide>
    </swiper-container>
  );
}
